var $bm_rt;
var kValOne, kValTwo, aStart;
try {
    if (thisLayer.marker.numKeys > 1 && numKeys >= 2) {
        kValOne = key(1).value;
        kValTwo = key(2).value;
        $bm_rt = aStart = $bm_sub(kValTwo, kValOne);
        if (time < thisLayer.marker.key(2).time) {
            $bm_rt = linear(time, thisLayer.inPoint, thisLayer.marker.key(1).time, kValOne, aStart);
        } else {
            $bm_rt = linear(time, thisLayer.marker.key(2).time, thisLayer.outPoint, kValTwo, kValOne);
        }
    } else {
        $bm_rt = value;
    }
} catch (ex) {
    $bm_rt = value;
}

