s.x:
var $bm_rt;
var w, h, aspect;
w = $bm_div(thisComp.width, 3840);
h = $bm_div(thisComp.height, 2160);
$bm_rt = aspect = 3840 / 2160;
if (w >= h) {
    $bm_rt = [
        value[0] * h / w,
        value[1]
    ];
} else {
    $bm_rt = [
        value[0],
        value[1] * w / h
    ];
}

